import { MEDIA_POPULAR, PEOPLE_POPULAR, ERROR } from '../Actions/types'

const INITIAL_STATE =  {
    media_popular:{
        "results": [
            {
            "id": '',
            "vote_count": '',
            "title": '',
            "release_date": '',
            "original_title": '',
            "backdrop_path": '',
            "poster_path": '',
            "media_type": ''
            },
        ]
    },
    people_popular:{
        "results": [
            {
            "id": '',
            "profile_path": '',
            "name": ''
            },
        ]
    },
    error: '',
};
export default (state = INITIAL_STATE, action) => {
    switch (action.type){
        case MEDIA_POPULAR:
            return{ ...state, media_popular: action.payload.results}
        case PEOPLE_POPULAR:
                return{ ...state, people_popular: action.payload}.results
        case ERROR:
            return{ ...state, error: action.payload }
        default:
         return state;
    } 

};
